const myHeaders = new Headers();
myHeaders.append("apikey", "sWi8jGLUyeX98IYg63YLju9VIBzdOs4N");

const requestOptions = {
  method: 'GET',
  redirect: 'follow',
  headers: myHeaders
};

fetch("https://api.apilayer.com/exchangerates_data/latest?symbols=&base=", requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));



export default function Rates() {
    async function convert(e) {
        e.preventDefault();
        try {
          const response = await fetch("https://api.apilayer.com/exchangerates_data/latest?symbols=&base=", requestOptions);

          if (response.success) {
            const json = await response.rates();
            console.log(json.rates);

          } else {
            alert("Error retrieving exchange rate.");
